import React from 'react';
import Navbar from '../navbar/navbar';
import { Name, MenuBar, HalfSection, AboutBody, MenuBarBackground } from './style';

export default function Home() {
    return (
        <AboutBody>
            <MenuBarBackground>
            <MenuBar>
                <Name>Daniel</Name>
                <Navbar />
            </MenuBar>
            </MenuBarBackground>
        </AboutBody>
        )
}
